import React, { Component } from "react";
import {Link} from "react-router-dom";
import { Row, Col, Form, Icon, Input, Button, Checkbox } from "antd";
import { Host } from  "../Host";
import axios from "axios";
const FormItem = Form.Item;


class SignupForm extends Component {
  constructor(props) {
    super(props);
    this.state = {
        first_name:null,
        cell_number:null,
        home_number:null,
        office_number:null,
        cell_err:null,
        fn_err:null,
        ln_err:null,
    };

  }

    myChangeHandler = (event) => {
    let nam = event.target.name;
    let val = event.target.value;
    let fn_err='';
    let ln_err='';
    let name_err='';
    let pwd_err='';
    let acc_err='';
    let cmpny_err='';
    let title_err='';
    let cell_err = '';
    let home_err = '';
    let office_err = '';
    let email_err = '';
    let addr_err = '';

    if (nam === "cell_number") {
      if (val !="" && !Number(val)) {
        cell_err = <h6><font color="red">should be a number</font></h6>;
       }
    }
    if (nam === "office_number") {
      if (val !="" && !Number(val)) {
        office_err = <h6><font color="red">should be a number</font></h6>;
        }
    }
    if (nam==="home_number") {
      if (val !="" && !Number(val)) {
        home_err = <h6><font color="red">should be a number</font></h6>;
        }
    }

//    this.setState({errormessage: err});
    this.setState({office_err: office_err, cell_err: cell_err, home_err: home_err});
    this.setState({[nam]: val});
  }


  handleSubmit = (e) => {
    e.preventDefault();
    let first_name = this.state.first_name;
    let last_name = this.state.last_name;
    let username  = this.state.username;
    let password = this.state.password;
    let account_type = this.state.account_type;
    let company = this.state.company;
    let title = this.state.title;
    let cell_number = this.state.cell_number;
    let office_number = this.state.office_number;
    let home_number = this.state.home_number;
    let email = this.state.email;
    let address = this.state.address;
    if (first_name ==null) {
        let fn_err = <h6><font color="red">Enter first_name</font></h6>;
        this.setState({fn_err: fn_err});
       } else this.setState({fn_err:''})

    if (last_name==null) {
      let ln_err = <h6><font color="red">Enter last name</font></h6>;
      this.setState({ln_err:ln_err});
    } else this.setState({ln_err:''})
    if (username==null) {
      let name_err = <h6><font color="red">Enter username</font></h6>;
      this.setState({name_err:name_err});
    } else this.setState({name_err:''})
    if (password==null) {
        let pwd_err = <h6><font color="red">Enter password</font></h6>;
        this.setState({pwd_err:pwd_err});
    } else this.setState({pwd_err:''})
    if (account_type==null) {
      let acc_err = <h6><font color="red">Enter account type</font></h6>;
      this.setState({acc_err:acc_err});
    } else this.setState({acc_err:''})
    if (company==null) {
     let cmpny_err = <h6><font color="red">Enter company name</font></h6>;
      this.setState({cmpny_err:cmpny_err});
    }else this.setState({cmpny_err:''})
    if (title==null) {
      let title_err = <h6><font color="red">Enter title</font></h6>;
        this.setState({title_err:title_err});
    } else this.setState({title_err:''})
    if (cell_number ==null) {
        let cell_err = <h6><font color="red">Enter cell number</font></h6>;
        this.setState({cell_err: cell_err});
       } else this.setState({cell_err:''})
    if (office_number==null) {
      let office_err = <h6><font color="red">should be a number</font></h6>;
        this.setState({office_err: office_err});
    }else this.setState({office_err:''})
    if (home_number==null) {
      let home_err = <h6><font color="red">should be a number</font></h6>;
      this.setState({home_err: home_err});
      } else this.setState({home_err:''})
    if (email==null) {
      let email_err = <h6><font color="red">Enter email address</font></h6>;
      this.setState({email_err: email_err});
      } else this.setState({email_err:''})
    if (address==null) {
      let addr_err = <h6><font color="red">Enter address</font></h6>;
      this.setState({addr_err: addr_err});
     } else this.setState({addr_err:''})

    this.SignupAPI({first_name:first_name, last_name:last_name, username:username, password:password,
        account_type:account_type, company:company, title:title, office_number:office_number,
        cell_number:cell_number, home_number:home_number, email:email, address:address
    })
  }

  async SignupAPI(data){

    const headers  = new Headers()
    headers.append('Content-Type', 'application/json');
    const options = {
    method : 'POST',
    headers,
    body:JSON.stringify(data),
    }

    const promise = await axios.post(Host.loginURL+"/signup_api", options);
    const status = promise.status;
    if(status==200)
    {
      const data = promise.data.data;
      this.setState(data);
      this.props.history.push("/");
   }
   else {this.setState({msg: "Username & Password not correct"});}

}


  render() {
    localStorage.clear();
    const { getFieldDecorator } = this.props.form;
    return (
      <div className="login-form-container">
        <div className="header-login">
          <div className="login-logo">
            <img src="/assets/images/logo-white.png" alt="SQ"/>
          </div>
        </div>
        <div className="login-row">
          <div className="login-cell cell-login-hero" style={{backgroundImage: 'url(/assets/images/login-bg.jpg)'}}>
            <div className="login-cell-block">
              <div className="login-cell-content">
                <div className="login-hero-content">
                  <h1 className="login-heading">Welcome to SQ</h1>
                  <div className="login-subheading">
                    <p>
                    This is the new face of SQ. New look, new ideas, same core
                    </p>
                  </div>
                  <div className="website-link">
                    <Link to='http://webmamu.com/static/qcn/'>www.sqgc.com/</Link>
                  </div>
                </div>
              </div>
            </div>
          </div>
          <div className="login-cell cell-login-form">
            <div className="bg-image-mobile" style={{backgroundImage: 'url(/assets/images/login-bg.jpg)'}}></div>
            <div className="login-cell-block">
              <div className="login-logo text-center">
                <img src="/assets/images/logo-white.png" alt="SQ"/>
              </div>
              <div className="logo-with-form login-cell-content">
                <h4 className="mb-3">Signup with SQ</h4>
               <Form layout="inline" onSubmit={this.handleSubmit}>

        <Form.Item>
          <Row gutter={8}>
            <Col span={12}>
              <Input name="first_name" value={this.state.first_name} onChange={this.myChangeHandler} size="large"  prefix={ <Icon type="user" style={{ color: "rgba(0,0,0,.25)" }} /> } type="" placeholder="FirstName" />
                {this.state.fn_err}
            </Col>
             <Col span={12}>
              <Input name="last_name" onChange={this.myChangeHandler} size="large" prefix={ <Icon type="user" style={{ color: "rgba(0,0,0,.25)" }} /> } type="" placeholder="LastName" />
                {this.state.ln_err}
            </Col>
          </Row>
        </Form.Item>

        <Form.Item>
          <Row gutter={8}>
            <Col span={12}>
                <Input name="username" onChange={this.myChangeHandler} size="large" prefix={ <Icon type="user" style={{ color: "rgba(0,0,0,.25)" }} /> } type="" placeholder="Username" />
                {this.state.name_err}
            </Col>
             <Col span={12}>
                <Input name="password" onChange={this.myChangeHandler} size="large" prefix={ <Icon type="lock" style={{ color: "rgba(0,0,0,.25)" }} /> } type="" placeholder="Password" />
                {this.state.pwd_err}
            </Col>
          </Row>
        </Form.Item>
        <Form.Item>
          <Row gutter={8}>
            <Col span={12}>
              <Input name="account_type" onChange={this.myChangeHandler} size="large" prefix={ <Icon type="book" style={{ color: "rgba(0,0,0,.25)" }} /> } type="" placeholder="AccountType" />
                {this.state.acc_err}
            </Col>
             <Col span={12}>
              <Input name="company" onChange={this.myChangeHandler} size="large" prefix={ <Icon type="home" style={{ color: "rgba(0,0,0,.25)" }} /> } type="" placeholder="Company" />
                {this.state.cmpny_err}
            </Col>
          </Row>
        </Form.Item>

         <Form.Item>
          <Row gutter={8}>
            <Col span={12}>
              <Input name="title" onChange={this.myChangeHandler} size="large" prefix={ <Icon type="title" style={{ color: "rgba(0,0,0,.25)" }} /> } type="" placeholder="Title" />
                {this.state.title_err}
            </Col>
             <Col span={12}>
              <Input name="office_number" onChange={this.myChangeHandler} size="large" prefix={ <Icon type="office" style={{ color: "rgba(0,0,0,.25)" }} /> } type="" placeholder="OfficeNumber" />
                {this.state.office_err}
            </Col>
          </Row>
        </Form.Item>
        <Form.Item>
          <Row gutter={8}>
            <Col span={12}>
              <Input name="cell_number" value = {this.state.cell_number} onChange={this.myChangeHandler} size="large" prefix={ <Icon type="phone" style={{ color: "rgba(0,0,0,.25)" }} /> } type="" placeholder="Phone" />
                {this.state.cell_err}
            </Col>
             <Col span={12}>
              <Input name="home_number" onChange={this.myChangeHandler} size="large" prefix={ <Icon type="home" style={{ color: "rgba(0,0,0,.25)" }} /> } type="" placeholder="HomeNumber" />
                {this.state.home_err}
            </Col>
          </Row>
        </Form.Item>
        <Form.Item>
          <Row gutter={8}>
            <Col span={12}>
              <Input name="email" onChange={this.myChangeHandler} size="large" prefix={ <Icon type="mail" style={{ color: "rgba(0,0,0,.25)" }} /> } type="" placeholder="Email" />
                {this.state.email_err}
            </Col>
             <Col span={12}>
              <Input name="address" onChange={this.myChangeHandler} size="large" prefix={ <Icon type="address" style={{ color: "rgba(0,0,0,.25)" }} /> } type="" placeholder="Address" />
                {this.state.addr_err}
            </Col>
          </Row>
        </Form.Item>
                 <Form.Item>
                     <Button
                      type="primary"
                      htmlType="submit"
                      size="large"
                      className="login-form-button"
                      style={{ width: "100%" }}
                    >
                      Signup
                    </Button>
                 </Form.Item>


              <Form.Item>

                <Button
                  type="primary"
                  htmlType="submit"
                  size="large"
                  className="btn-info"
                  style={{ width: "100%" }}
                >
                  <Link to='/' style={{textDecoration:"none"}}>Cancel</Link>
                </Button>

              </Form.Item>
      </Form>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}


const WrappedSignupForm = Form.create()(SignupForm);

export default WrappedSignupForm;
